import { Component, OnInit } from '@angular/core';
import { HttpClient, HttpParams } from '@angular/common/http';
import { StudentLayoutComponent } from '../student-layout/student-layout.component'
import { ActivatedRoute, Router } from '@angular/router';
import { StudentResolve } from './resolve.service'
import { DocumentServices } from './document.service'
import { Student, Report,Document } from '../student-index/student'
import { ConfigService } from '../config/config.service'
import { FormGroup, FormControl, Validators } from '@angular/forms';
@Component({
  selector: 'app-documents',
  templateUrl: './documents.component.html',
  styleUrls: ['./documents.component.css'],
  providers: [ConfigService, DocumentServices, StudentResolve]

})
export class DocumentsComponent implements OnInit {
  newReportForm: FormGroup;
  newDocumentForm: FormGroup;

  filesToUpload: Array<File> = [];
  students: Student
  report: Report
  document:Document
  constructor(private http: HttpClient, private DocumentServices: DocumentServices, private StudentLayoutComponent: StudentLayoutComponent, private route: ActivatedRoute, private router: Router, private studentResolve: StudentResolve) { }

  ngOnInit(): void {
    this.DocumentServices.getStudentService(this.route.snapshot.parent.params.id)
      .subscribe(res => {
        this.students = res.body

      })
    console.log('DOC ::: ', this.route.snapshot.parent.params.id)
this.createForm()
  }

  createForm() {
    this.newReportForm = new FormGroup({
      'name': new FormControl('', [
        Validators.required,
      ]),
      'report': new FormControl('', [
        Validators.required,
     
      ]),
  
    })
    this.newDocumentForm = new FormGroup({
      'document': new FormControl('', [
        Validators.required,
      ]),
      'message': new FormControl('', [
     
      ]),
  
    })
  }
  onSubmit(){
    this.report = this.newReportForm.value
    this.postReport()
  }
  onDocumentSubmit(){
    
    this.document = this.newDocumentForm.value
    this.postDocument()

  }

  
  upload() {

      const formData: any = new FormData();
      const files: Array<File> = this.filesToUpload;
      console.log(files);

      for(let i = 0; i<files.length; i++){
      formData.append("StudentReports[]", files[i], files[i]['name']);
    }
    console.log('form data variable :   ' + formData.toString());
    this.http.post('http://localhost:4000/StudentReport', formData)
      .subscribe(files => console.log('files', files))
  }

  fileChangeEvent(fileInput: any) {

    this.filesToUpload = <Array<File>>fileInput.target.files;
    //this.product.photo = fileInput.target.files[0]['name'];
  }
  DocUpload() {

    const formData: any = new FormData();
    const files: Array<File> = this.filesToUpload;
    console.log(files);

    for(let i = 0; i<files.length; i++){
    formData.append("TC_documents[]", files[i], files[i]['name']);
  }
  console.log('form data variable :   ' + formData.toString());
  this.http.post('http://localhost:4000/TC_documents', formData)
    .subscribe(files => console.log('files', files))
}



  postReport() {
    this.DocumentServices
      .postReportService(this.report)
      .subscribe(res => {

        console.log(res)
      })
    
  }

  postDocument() {
    this.DocumentServices
      .postDocumentService(this.document)
      .subscribe(res => {

        console.log(res)
      })
    }

    showPdf() {
      
       
         
            const linkSource = 'data:application/pdf;base64,' + "";
            const downloadLink = document.createElement("a");
            const fileName = "TrainingPlan.pdf";
  
            downloadLink.href = linkSource;
            downloadLink.download = fileName;
            downloadLink.click();
          
       
  
    }
}
